import { Button, Card } from "react-bootstrap";
import { Trash3Fill } from "react-bootstrap-icons";
import { DayProps } from "../Interfaces/Day";

function Foo({day}: DayProps) {
  const handleFoo = async (e: React.MouseEvent<HTMLButtonElement, MouseEvent>) => {
    const response = await fetch(`http://localhost:5000/api/day/{day.id}`, {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(day),
    });
  };

  return (
    <Card.Body>
      <Card.Title>
        {day.name} <Button className="btn-trash float-end" onClick={handleFoo}><Trash3Fill /></Button>
      </Card.Title>
    </Card.Body>
  );
}

export default Foo;
